const container = document.getElementById('container');
const canvas = document.getElementById('canvas1');
const file = document.getElementById('fileupload');
canvas.width = window.innerWidth;
canvas.height = window.innerHeight;
const ctx = canvas.getContext('2d');


container.addEventListener('click', function(){
    const audio1 = document.getElementById('audio1');
    audio1.src = 'data:audio/x-way;base64,'
    const audioCtx = new AudioContext();
    audioSource = audioCtx.createMediaElementSource(audio1);
    analyser = audioCtx.createAnalyser();
    audioSource.connect(analyser);
    analyser.connect(audioCtx.destination);
    analyser.fftSize = 256; //nr of analizer bars
    const bufferLength = analyser.frequencyBinCount; //nr of data samples
    const dataArray = new Uint8Array(bufferLength); //convert bufferLenght in a specific format
    
    const barWidth = (canvas.width/2) / bufferLength; //width of single bar
    let barHeight; //change in height of bar
    let x; //each time I print a bar it will increment by the barWidth

    function animate(){
        x = 0;
        ctx.clearRect(0, 0, canvas.width, canvas.height);
        analyser.getByteFrequencyData(dataArray);
        drawVisualizer(bufferLength, x, barWidth, barHeight, dataArray);
        requestAnimationFrame(animate);
    };
    animate();
});

file.addEventListener('change',function(){
    const files = this.files;
    console.log(this.files);
    const audio1 = document.getElementById('audio1');
    audio1.src = URL.createObjectURL(files[0]);
    //audio1.load();
    audio1.play();
    audioSource = audioCtx.createMediaElementSource(audio1);
    analyser = audioCtx.createAnalyser();
    audioSource.connect(analyser);
    analyser.connect(audioCtx.destination);
    analyser.fftSize = 1024; //analizer bars
    const bufferLength = analyser.frequencyBinCount; //nr of data samples
    const dataArray = new Uint8Array(bufferLength); //convert bufferLenght in a specific format

    const barWidth = (canvas.width/2) / bufferLength; //width of single bar
    let barHeight; //change in height of bar
    let x; //each time I print a bar it will increment by the barWidth

    function animate(){
        x = 0;
        ctx.clearRect(0, 0, canvas.width, canvas.height);
        analyser.getByteFrequencyData(dataArray);
        drawVisualizer(bufferLength, x, barWidth, barHeight, dataArray);
        requestAnimationFrame(animate);
    };
    animate();
});

function drawVisualizer(bufferLength, x, barWidth, barHeight, dataArray)
{
    for (let i = 0; i < bufferLength; i++){
        barHeight = dataArray[i] * 1.5;
        const red = i * barHeight / 2;
        const green = i * 4;
        const blue = barHeight / 2;
        ctx.fillStyle = 'rgb(' + red + ',' + green + ',' + blue + ')';
        ctx.fillRect(canvas.width/2 - x, canvas.height - barHeight, barWidth, barHeight);
        x += barWidth;
    }
    for (let i = 0; i < bufferLength; i++){
        barHeight = dataArray[i] * 1.5;
        const red = i * barHeight / 2;
        const green = i * 4;
        const blue = barHeight / 2;
        ctx.fillStyle = 'rgb(' + red + ',' + green + ',' + blue + ')';
        ctx.fillRect(x, canvas.height - barHeight, barWidth, barHeight);
        x += barWidth;
    }
    
}